import React from 'react';
import RecentWordItem from './RecentWordItem';

const RecentWordsList = ({ word }) => {
  console.log(word)
  return (
    <ul className="recent-words-list">
      <RecentWordItem word={word} />
    </ul>
  )
}

export default RecentWordsList;
